var modules={"module":{"images":{"qrcode.png":"data:image/png;base64,","shareicon.png":"data:image/png;base64,"},"index.html":"<html>\n    <head>\n        <title>分享</title>\n    </head>\n    <body>\n        <div class='share'>\n            <div class='share-text'>-分享-</div>\n            <div><a href='#' id='share-wechat' class='share-pic share-wechat'></a></div>\n            <div><a href='${it.weiboShareUrl}' id='share-weibo' class='share-pic share-weibo'></a></div>\n            <div><a href='${it.qqShareUrl}' id='share-qq' class='share-pic share-qq'></a></div>\n            <div><a href='${it.qzoneShareUrl}' id='share-qzone' class='share-pic share-qzone'></a></div>\n            <div id='qrcode' class='qrcode'></div>\n        </div>\n    </body>\n</html>","readme.md":"## Share","package.json":"{\n    \"name\": \"share\",\n    \"version\": \"1.0.0\",\n    \"description\": \"Viewport Slider React component.\",\n    \"main\": \"./index.js\"\n}","index.js":"import $ from 'Jquery';\nimport css from './index.scss';\nimport render from './tpl.xhtml';\n\nexport default function (data, utils = {}) {\n  let it = renderShare(data);\n  let html = render(it, utils, css);\n\n  return html;\n}\n\nfunction renderShare (data) {\n  let objShare = {}\n  var p = {\n    url: location.href, /* 获取URL，可加上来自分享到QQ标识，方便统计 */\n    showcount: '0',/* 是否显示分享总数,显示：'1'，不显示：'0' */\n    desc: '分享：' + data.title, /* 分享理由(风格应模拟用户对话),支持多分享语随机展现（使用|分隔） */\n    title: data.title, /* 分享标题(可选) */\n    summary: '', /* 分享摘要(可选) */\n    pics: data.picurl, /* 分享图片(可选) */\n    pic: data.picurl, /* 微博用的分享图片(可选) */\n    flash: data.videourl || '', /* 视频地址(可选) */\n    site: '搜狗浏览器', /* 分享来源(可选) 如：QQ分享 */\n    style: '201',\n    width: 32,\n    height: 32\n  }\n  var s = [];\n  for (var i in p) {\n    s.push(i + '=' + encodeURIComponent(p[i] || ''));\n  }\n  objShare.qqShareUrl = 'http://connect.qq.com/widget/shareqq/index.html?' + s.join('&');\n  objShare.qzoneShareUrl = 'http://sns.qzone.qq.com/cgi-bin/qzshare/cgi_qzshare_onekey?' + s.join('&');\n  objShare.weiboShareUrl = 'http://service.weibo.com/share/share.php?' + s.join('&');\n\n  return objShare;\n}\n\nfunction buildQrCode () {\n  let qrUrl = location.href.replace('pcshare', 'mshare');\n  $('#qrcode').qrcode({width: 132, height: 132, text: qrUrl});\n}\n\n$('body').delegate('#share-wechat', 'mouseover', function (e) {\n  $('#qrcode').html('');\n  buildQrCode();\n  $('#qrcode').show();\n})\n\n$('body').delegate('#share-wechat', 'mouseout', function (e) {\n  $('#qrcode').hide();\n})\n","index.scss":".share {\n  position: fixed;\n  top: 180px;\n  left: 50%;\n  width: 60px;\n  height: 235px;\n  border-radius: 5px;\n  background-color: #ffffff;\n  box-shadow: 0 0 10px 0 rgba(124, 124, 124, 0.1); }\n  .share .share-text {\n    font-size: 14px;\n    color: #bbbbbb;\n    text-align: center;\n    line-height: 35px; }\n  .share .share-pic {\n    display: block;\n    background-image: url(data:image/png;base64,);\n    width: 48px;\n    height: 48px;\n    background-size: 200%;\n    margin-left: 6px; }\n  .share .share-wechat {\n    background-position: 0px 0px; }\n  .share .share-wechat:hover {\n    background-position: -48px 0px; }\n  .share .share-weibo {\n    background-position: 0px -48px; }\n  .share .share-weibo:hover {\n    background-position: -48px -48px; }\n  .share .share-qq {\n    background-position: 0px -96px; }\n  .share .share-qq:hover {\n    background-position: -48px -96px; }\n  .share .share-qzone {\n    background-position: 0px -144px; }\n  .share .share-qzone:hover {\n    background-position: -48px -144px; }\n\n.qrcode {\n  display: none;\n  position: absolute;\n  top: 26px;\n  left: 51px;\n  background-image: url(data:image/png;base64,);\n  background-position: 0px 0px;\n  background-repeat: no-repeat;\n  width: 160px;\n  height: 157px;\n  background-size: 200px 212px;\n  margin: 0px;\n  padding-left: 40px;\n  padding-top: 55px; }\n"},"lib":{"Jquery":1},"entry":"./index.js"}